<h1> About Me</h1>

<p class=""par"">
   I have a creative and analytical background.  I have been involved and directed many video productions for profit and volunteer.  In 2001, I received my Bachelor's Degree in Radio/TV Production from the University of Central Florida.  In 2007, I started A Majestic Moments Digital Studios, a special events and wedding videography company where I maintained our company website through Wix including learning about search engine optimization and how that can benefit a company by driving traffic to your website.  In 2009, I received computer tech training from New Horizons Computer Learning Center.  I am Comptia A+ and Network+ Certified.  I have also worked medical billing, data and claims analysis.
